import {Heading3} from './headings'

function Main() {
  return (
    <main className="grid grid-main">
      <Heading3 children="Loren Inpsum" />
      <p>
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis pulvinar,
        quam sed venenatis ornare, mi lectus euismod odio, ut sagittis dui dui
        at leo. Ut luctus libero augue, pellentesque pellentesque ante efficitur
        nec. Vestibulum eu velit tortor. Nullam ac luctus sem. Etiam feugiat
        sapien non erat blandit, non ornare est interdum. Cras et orci dui. Duis
        lacinia pellentesque augue, sed tempor tortor vestibulum in. Proin
        efficitur sem leo, ac blandit leo bibendum ac. Mauris vitae aliquet
        tellus. Integer sed fringilla dolor. Donec tellus risus, eleifend at
        luctus a, fringilla sit amet tellus.
      </p>
    </main>
  );
}

export default Main;
